  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:42.325804\",\n\t\"name\": \"assessment-of-blood-contaminant-residues-in-delaware-bay-bald-eagle-nestlings\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The bald eagle population around the lower
  Delaware River Basin is rebounding from near extirpation in the early 1970's to
  14 active breeding pairs today. Environmental contaminants such as PCBs, DDT, and
  mercury have been implicated as affecting reproductive success, impairing behavior,
  and impacting metabolic functions. Between 1993 and 1996, blood was collected from
  35 eaglets inhabiting the Delaware River basin of New Jersey and Delaware. Samples
  were examined for PCBs, chloro substituted dibenzo-p-dioxins and dibenzofurans,
  pesticides, and elemental residue levels. Overall, the contaminants analyzed were
  below levels associated with immediate physiological or behavioral impacts; however,
  chronic and sublethal effects may still be manifestated by bioaccumulation, or other
  metabolic pathways later in the eaglet's life. Continued monitoring of contaminant
  residues in this population is recommended.\",\n\t\"license_title\": \"License Not
